import React from 'react';
// dependencies
import { Routes, Route } from "react-router-dom";
// import css files
import './css/style.css';
// components 
import Search from './components/Search';
import EventList from './components/EventList';
function App() {
  return (
    <>
      <Search />
      <EventList />
      <Routes>
        <Route path="/" element={<App />} />
      </Routes>
    </>
  );
}

export default App;
